import { Injectable } from '@angular/core';
import { loguinRequest } from './loguinRequest';

@Injectable({
  providedIn: 'root'
})
export class LoginformService {

  constructor() { }

  login( credentials: loguinRequest ){
    console.log(credentials);
  }
}
